import { BASE_PATH, apiVersion } from "../config";

export function agregarUsuariosApi(data) {

    const url = `${BASE_PATH}/${apiVersion}/agregar-Usuario`;
    const params = {

        method: "POST",
        body: JSON.stringify(data),
        headers: {
            "Content-Type": "application/json"
        }

    };

    console.log(data);


    fetch(url, params)
        .then(response => {

            console.log(response);
        });
}
